pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/Strings.sol";

contract HelloWorld {
  uint256 public counter = 0;
  function sayHello() public returns (string memory) {
        return (Strings.toString(counter++));
    }
}
